function Profiles() {

  // Aquí se hari
  const profiles = [
    { id: 1, name: 'John Doe', age: 30 },
    { id: 2, name: 'Jane Smith', age: 25 }, 
    { id: 3, name: 'Alice Johnson', age: 28 },
    { id: 4, name: 'Bob Brown', age: 35 },  
    { id: 5, name: 'Charlie White', age: 22 }
  ];

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Profiles Page 
        </p>
      </header>
    </div>
  )
}
export default Profiles;
